      display: flex;
      justify-content: center;
      padding: 18px 0;
    }

    &__button-prev {
      position: absolute;
      left: 5%;
      top: 39%;

      z-index: 100;
    }

    &__button-next {
      position: absolute;
      right: 5%;
      top: 39%;

      z-index: 100;
    }
  }

  &-projects {

    &__slide {
      display: flex;
      justify-content: center;
      flex-direction: column;
